INSERT INTO `componentproperty` VALUES ('MTBUR', 'Mean Time Between Unscheduled Removals.The value of an MTBUR defines the period after that an unscheduled removal of a part from an aircraft is expected. The MTBUR is a 6 digit figure in conjunction with two further data elements, the Time Cycle Code (TCC) and the Removal Rate Indicator (RRI).', '');
